import React from 'react';

import indexImage from '../../assets/index.svg';

import {
  Container,
  Text,
  Button,
  ButtonIcon,
  Image,
  ImageBackground,
} from './styles';

const Index: React.FC = () => {
  return (
    <Container>
      <Text>Encontre dados do Covid-19 em Sergipe</Text>
      <Image>
        <ImageBackground src={indexImage} alt="Logo de SE" />
      </Image>
      <Button>
        Ver Dados
        <ButtonIcon />
      </Button>
    </Container>
  );
};

export default Index;
